import React, { useState, useEffect } from 'react';
import { NavLink } from 'react-router-dom';
import { Navbar, Nav, Container } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Navigation.css';

const Navigation = () => {
  const [menuOpen, setMenuOpen] = useState(false);
  const [activeTab, setActiveTab] = useState(sessionStorage.getItem('activeTab') || 'about');

  useEffect(() => {
    sessionStorage.setItem('activeTab', activeTab);
  }, [activeTab]);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  const closeMenu = () => {
    setMenuOpen(false);
  };

  const openNav = () => {
    document.getElementById("mySidebar").style.width = "100%";
    document.getElementById("openbtn").style.marginRight = "100%";
  };

  const closeNav = () => {
    document.getElementById("mySidebar").style.width = "0";
    document.getElementById("openbtn").style.marginRight = "0";
  };

  const openTab = (tabName) => {
    setActiveTab(tabName);
    closeMenu();
  };

  return (
    <div className={`overlay-menu ${menuOpen ? 'open' : ''}`}>
      <Navbar expand="lg" className="custom-navbar">
        <Container>
          <Navbar.Brand className="logo-container">
            <img
              src={`${process.env.PUBLIC_URL}/img/sp-logo.svg`}
              height="30"
              className="align-top color-black logo"
              alt="Stackpackers Logo"
            />
          </Navbar.Brand>
          <Navbar.Collapse id="responsive-navbar-nav" className={`justify-content-center ${menuOpen ? 'show' : ''}`}>
            <Nav className="align-items-center custom-nav">
              <Nav.Link as={NavLink} to="/" exact onClick={() => openTab('home')}>Home</Nav.Link>
              <Nav.Link as={NavLink} to="/portfolio" onClick={() => openTab('about')}>About</Nav.Link>
              <Nav.Link as={NavLink} to="/resume" onClick={() => openTab('music')}>Music</Nav.Link>
              <Nav.Link as={NavLink} to="/skills" onClick={() => openTab('events')}>Events</Nav.Link>
              <Nav.Link as={NavLink} to="/contact" onClick={() => openTab('contact')}>Contact</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <button id="openbtn" className="open-menu" onClick={openNav}>☰</button>
      <div id="mySidebar" className="sidebar">
        <button className="closebtn" onClick={closeNav}>×</button>
        <ul>
          <li onClick={() => openTab('home')}>About</li>
          <li onClick={() => openTab('portfolio')}>Portfolio</li>
          <li onClick={() => openTab('resume')}>Resume</li>
          <li onClick={() => openTab('skills')}>Skills</li>
          <li onClick={() => openTab('contact')}>Contact</li>
        </ul>
      </div>

      <div id="about" className="section" style={{ display: activeTab === 'about' ? 'block' : 'none' }}></div>
      <div id="portfolio" className="section" style={{ display: activeTab === 'portfolio' ? 'block' : 'none' }}></div>
      <div id="resume" className="section" style={{ display: activeTab === 'resume' ? 'block' : 'none' }}>Resume Content</div>
      <div id="skills" className="section" style={{ display: activeTab === 'skills' ? 'block' : 'none' }}>Skills Content</div>
      <div id="contact" className="section" style={{ display: activeTab === 'contact' ? 'block' : 'none' }}>Contact Content</div>
    </div>
  );
};

export default Navigation;
